export class CheckProfileStatusResponseModel
{
   bucketInfo: BucketInfoModel[] = []; 
    errorDoc: ErrorDocModel =new ErrorDocModel;
}
export class BucketInfoModel
{
    currentBucketId!:string;
    currentBucketName!:string;
    isRnR!:string;
    rnRText!:string;
    optionsList:OptionsListModel[]=[];
   errorDoc:ErrorDocModel=new ErrorDocModel;
}
export class ErrorDocModel
{
    status!:string;
    errorCode!:string;
    errorMessage!:string;
}
export class OptionsListModel
{
    optionId!:string;
    optionName!:string;
}
